import React, { Component } from 'react';
import MenuAppBar from '../components/MenuAppBar'
import CardProduct from '../components/CardProduct'
import { withStyles } from '@material-ui/core/styles';

class ProductDetail extends Component {
  render() {

    var user = {
        userName : 'Phan Lê Trung Hiếu (Stage name: Hiếu Đẹp Trai)',
        position : 'Providers of clean farm produce.',
        image : 'https://scontent.fsgn5-2.fna.fbcdn.net/v/t1.0-9/43951894_1884451351651332_8635442626654371840_n.jpg?_nc_cat=105&_nc_eui2=AeEbQLkuqRNg1J-fyhX3OXbTsMd1B3YVTkAwuBBQPfOhE41aG2gcEh47VRXkqI1zZHlYLIySVOFsL5GOg16Y8JJeQkoF7yZg_qU0fBVKJz8pkQ&_nc_ht=scontent.fsgn5-2.fna&oh=7633220fe81f20b7eb4ac55c5cb37e97&oe=5CA941E1',
    }

    return (
        <div>
            <MenuAppBar></MenuAppBar>
            <CardProduct
             userName= {this.user.userName} 
             position= {this.user.position} 
             image= {this.user.image} 
            ></CardProduct>
        </div>
    );
  } 
}

export default ProductDetail;
